span.catch_copy,
span.item_name {
  line-height: 100%;
}

/* 【現在非表示】キャッチコピー上部にラベルがつく 
span.catch_copy:before {
    content: "全商品ポイント3倍！"; /*ラベル内の文言*/
    width: 160px; /*ラベルのサイズ*/
    background-color: #bf0000; /*ラベルの色*/
    font-size: 15px;
    color: #fff;
    text-align: center;
    display: block;
    padding: 1px 4px;
    margin-bottom: 4px;
    border-radius: 2px;
    clear: both;
}
*/

/* 商品名下に境界線が入る */
span.item_name {
    display: block;
    border-bottom: 2px dotted #ddd;
    padding-bottom: 8px;
}

/* 価格に枠線がつく */
table#rakutenLimitedId_cart {
    background-color: #f8f8f8;
    border: 1px solid #ddd;
    padding: 8px;
    margin: 16px 0;
}

span.price1 {
    color: #333 !important;
    font-weight: bold;
    font-size: 80% !important;
    line-height: 30px;
    display: inline-block;
    margin-right: 16px;
}

-->

/*------------------------------------------------------------*/
/**
 お気に入り商品登録
*/
#rakutenLimitedId_aroundCart #serviceTableSml td.favorite { padding-top: 5px; }

#rakutenLimitedId_aroundCart div.bookmarkArea div.bkm {
	width: 410px !important;
	height: 85px !important;
	padding: 0px 0px !important;
	padding-bottom: 0px !important;
}

#rakutenLimitedId_aroundCart div.bookmarkArea div.bkm a.addBkm {
	width: 410px !important;
	height: 85px !important;
}

#rakutenLimitedId_aroundCart div.bookmarkArea div.bkm a.addBkm span.bkmStar {
	display: inline-block !important;
	width: 410px !important;
	height: 85px !important;
	margin:10px 0px 30px 0px !important;
	background: url(http://image.rakuten.co.jp/golftheory/cabinet/0000/cart_okini_item.gif) no-repeat !important;
}

/**
 お気に入り店舗登録
*/

div.bookmarkArea {
	width: 410px;
}

#rakutenLimitedId_aroundCart div.shopBookmarkArea div.shopBkm {
	width: 410px !important;
	height: 35px !important;
	padding: 0px 0px !important;
	padding-left: 0px !important;
}

#rakutenLimitedId_aroundCart div.shopBookmarkArea div.shopBkm a.addShopBkm span.shopBkmStar {
	display: inline-block !important;
	width: 410px !important;
	height: 35px !important;
	margin-right: 0px !important;
	background: url(http://image.rakuten.co.jp/golftheory/cabinet/0000/cart_okini_shop.gif) no-repeat !important;
}

</style>







