　アメリカで一貫した高品質と高性能で高い評価を得てきた名門パワービルトのドライバークラブです。<BR> <BR>

【スペック】<BR>
・右打用/左打用<BR>
・クラブ長さ：45インチ<BR>
・重量：約355g<BR>
・ロフト角：10.5°<BR>
・ライ角：58°<BR>
<BR>
・フェースアングル：スクエア<BR>
・ヘッド素材：アロイ<BR>
・容量：460cc<BR>
・ホーゼル径：0.335"<BR>
<BR>
・シャフト：POWER BLIT Blackout カーボン<BR>
（フレックス：M/トルク：4.0）<BR>
・グリップ：POWER BLIT カスタム ベルベット<BR>
（バックライン無）<BR>
・オリジナルヘッドカバー付き<BR><BR>

※スペック値は参考値となりますので、誤差が生じる場合が御座います。<div class="img-block">
 <img src="" alt="" />  
</div>
